# Try a different approach - extract just the hex values directly from each sublist
def extract_hex_values(cypher):
    flag = ""
    for item in cypher:
        if isinstance(item, list):
            for val in item:
                if isinstance(val, str) and val.startswith('0x'):
                    try:
                        flag += chr(int(val, 16))
                    except ValueError:
                        pass
    return flag

